import {BrowserRouter as Router, Routes ,Route} from 'react-router-dom';
import './App.css';
import Fetch from './pro';
import Cart from './addcart';

function App() {
  return (
    <div>
        <Router>
              <Routes>
                     <Route path="/" element={<Fetch/>} />
                     <Route path="/addcart" element={<Cart/>} />
              </Routes>
        </Router>
    </div>
  );
}

export default App;
